import { BrowserRouter, Routes, Route } from "react-router-dom";import Layout from '../../password-manager/arcive_for_now/src/pages/Layout';
import './App.css'
import Layout1 from './Layout1'
import NavbarMain from './components/NavbarMain';
import HomePage from './HomePage';


export default function App() {
  return (
    <main className = "app-shell">
      <header>
        <NavbarMain />
      </header>
    <body>
    </body>
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Layout1 />}>
              <Route index element={<HomePage />} />
            </Route>
          </Routes>
        </BrowserRouter>
      <footer className="bottom-feeder">Taylor Kuno Â© 2022</footer>
    </main>
  );
};
